<html>
<head>
<style>
.report {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
}

.section {
    width: 210mm;
    height: 297mm;
    background-color: white;
    color: black;
    margin: 10px;
    text-align: center;
    padding:50px;
    box-sizing: border-box;
    word-break: break-word;
    overflow: auto;
    position: relative;
}

.section h2 {
    font-family: "Arial Black", Arial, Helvetica, 'Open Sans', sans-serif;
    font-weight: normal;
}

.heading {
    margin-top: 20px;
    margin-bottom: 5px;
    font-size: 16px;
}

.value {
    font-size: 22px;
    padding: 0;
    margin: 0;
}

.date {
    margin-bottom: 40px;
    font-size: 20px;
}

.title {
    font-family: "Arial Black", Arial, Helvetica, 'Open Sans', sans-serif;
    font-weight: normal;
    padding: 0;
    margin: 0;
}

.subtitle {
    font-weight: bold;
    padding: 0;
    margin: 0;
    margin-top: 5px;
}

.logo {
    display: block;
    margin-left: auto;
    margin-right: auto;
    margin-bottom: -50px;
    width: 430px;
}

.rainbow {
    display: block;
    margin-top: -145px;
    width: 400px;
    z-index: -1;
}

.table-row {
    display: table;
    height: 100%;
    width: 100%;
}

.table-column {
    display: table-cell;
    height: inherit;
}

.col-left {
    width: 50px;
}

.side-bar {
    display: block;
    height: inherit;
    width: 50px;
    margin-right: 40px;
}

.side-bar-text {
    font-family: "Arial Black", Arial, Helvetica, 'Open Sans', sans-serif;
    font-weight: normal;
    font-size: 25pt;
    transform: rotate(90deg) translateY(-100%);
    transform-origin: 0 0;
    min-width: 1018px;
    padding-bottom: 3px;
    padding-left: 15px;
    color: white;
}

.rule-details {
    padding-left: 12px;
    text-align: left;
    height: 100%;
}

.rule-details img {
    width: 100%;
    max-height: 700px;
}

.rule-details p { margin: 1px; }

.left-border { border-left: 7px solid }

.purple-border { border-color: #593580; }
.orange-border { border-color: #ec6307; }
.blue-border { border-color: #033dfc; }


.sb-rule-notes { background-color: #75d2d8; }
.sb-rule-features-0 { background-color: #66c999; }
.sb-rule-features-1 { background-color: #fab743; }
.sb-rule-features-2 { background-color: #E46138; }
.sb-rule-contents { background-color: #75d2d8; }

@supports (-moz-appearance:none) {
    .side-bar-wrapper{
        height: 100%
    }
}

.feature {
    margin-top: 15px;
    font-size: 20px;
    font-weight: 100s;
}

.rule {
    margin-left: 15px;
    font-size: 15px;
}

.caption {
    font-size: 14px;
    font-style: italic;
    font-weight: 300s;
}

.description {
    font-size: 11px;
    font-weight: 200;
}

#toc {
    width: inherit;
}

#toc ul {
    list-style-type: none;
    margin-right: 30px;
}

#toc li a::after {
    content: attr(page);
    float: right;
}

.toc-underline {
    display: block;
    width: 100%;
    height: 5px;
    margin: 15px 0;
}

#toc li {
    font-size: 20px;
}

#toc a {
    text-decoration: none;
    color: black;
}

.page-number {
    width: 50px;
    bottom: 0;
    position:absolute;
    margin-bottom: 80px;
    font-size: 25pt;
    font-weight: bold;
    color: white;
    z-index: 999;
}
</style>
</head>
